import "./App.css";
import React from "react";
import Home from "./components/home/Home";
import { BrowserRouter, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <h1>Henry Dogs</h1>
      <BrowserRouter>
        <Route exact path="/" element={<Home />} />
      </BrowserRouter>
    </div>
  );
}

export default App;
